function style(feature) {
	if(feature.geometry_name == "Shape") {
		return {
		 color: '#FF0000',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
	}
	else  {
    	return {
         color: '#22ff00',
         weight: 2.5,
         opacity: 0.9,
         fillOpacity: 0.1
        }
    }
};

function highlightFeature(border) {
	var layer = border.target;
	layer.setStyle ({
		weight: 5,
        color: '#FFD700',
        fillOpacity: 0.3
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

 function resetHighlight(border) {
    geojson.resetStyle(border.target);
}

function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
    })	
    if (feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
}

var geojson = L.geoJson(securityFence, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);

var geojson = L.geoJson(greenLine, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);


